import  MenuItem  from '../../Atoms/MenuItem/MenuItem';
import React from 'react';
import "./style.css";
import Logo from "../Atoms/Logo/Logo";
class Menu extends React.Component {
    
    render() {
        return (
            <>
            <Logo/>
                <ul className="list">
                    {this.props.list.map(item => (
                        <>
                            <MenuItem key={item.id} item={item} />
                        </>
                    ))}
                </ul>
                
            </>
        );
    }
}

export default Menu;
